INSERT INTO `blog` (`no`, `id`, `title`, `head`, `public`, `text`, `time`) VALUES
(3, 'started', 'Started', 'The site started in beta phase on 30 March, 2014.\r\nYou can find here the results of the official Formula One Grands Prix since 1950 with interesting statistics. Stay up to date with the latest updates!', 1, '<p>My site is in beta phase, so I&#39;m constantly adding many-many features to it. If you&#39;ve found some bugs, mistakes in the datas os just have a suggestion, please let me know of it.<br />\r\nSubscribe for updates on <a href="https://www.facebook.com/racedata">Facebook</a>, <a href="https://twitter.com/racedatanet">Twitter</a> or <a href="http://race-data.net/rss">Rss</a>. Thanks!</p>\r\n\r\n<p>Base functions (30 March 2014)</p>\r\n\r\n<ul>\r\n	<li>It&#39;s finally working :)</li>\r\n	<li><a href="http://race-data.net/f1">Seasons</a>\r\n	<ul>\r\n		<li>Drivers&#39;, constructors&#39; championship</li>\r\n	</ul>\r\n	</li>\r\n	<li><a href="http://race-data.net/driver">Drivers</a>\r\n	<ul>\r\n		<li>Career history</li>\r\n		<li>Social media channels</li>\r\n	</ul>\r\n	</li>\r\n	<li><a href="http://race-data.net/team">Teams</a>\r\n	<ul>\r\n		<li>Detailed results</li>\r\n		<li>Social media channels</li>\r\n	</ul>\r\n	</li>\r\n	<li>Grands Prix\r\n	<ul>\r\n		<li>Practice, qualifying, race results</li>\r\n		<li>Updated during grand prix weekends</li>\r\n	</ul>\r\n	</li>\r\n	<li><a href="http://race-data.net/circuit">Circuits</a>\r\n	<ul>\r\n		<li>Live weather (theweather.com)</li>\r\n	</ul>\r\n	</li>\r\n	<li>Constructors\r\n	<ul>\r\n		<li><a href="http://race-data.net/chassis">Chassis constructors</a></li>\r\n		<li><a href="http://race-data.net/engine">Engine manufacturers</a></li>\r\n		<li><a href="http://race-data.net/tyre">Tyre suppliers</a></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n', '2014-03-30 20:36:00'),
(4, 'cs', 'Csá!', 'Levente egy buzi', 0, '<p>Levente egy buzi</p>\r\n', '2014-10-22 20:03:00');
